import React from 'react';

const Navegacion = () => {
    return (
        <>
            <nav>
                <ol>
                    <li>
                        <span>Enlaces Clasicos</span>
                        <a href="/contacto">Contacto</a>
                        <a href="/acerca">Acerca</a>
                        <a href="/">Home</a>
                    </li>
                </ol>
            </nav>
        </>
    );
}

export default Navegacion;
